Other provisions of the Dodd-Frank Act include: •Capital Requirements. The Dodd-Frank Act: increased the minimum Tier 1 capital ratio from 4.00% to 6.00% of risk-weighted assets; created a new category and required 4.50% of risk-weighted assets ratio for “common equity Tier 1” as a subset of Tier 1 capital limited to common equity; established a minimum non-risk-based leverage ratio set at 4.00%, eliminating a 3.00% exception for higher rated banks; changed the permitted composition of Tier 1 capital to exclude trust preferred securities (unless issued prior to May 19, 2010 by a bank holding company with less than $15 billion in assets), mortgage servicing rights and certain deferred tax assets and included unrealized gains and losses on available for sale debt and equity securities; added an additional capital conservation buffer of 2.5% of risk-weighted assets over each of the required capital ratios, which must be met to avoid limitations on the ability to pay dividends, repurchase shares or pay discretionary bonuses; changed the risk weights of certain assets for purposes of calculating the risk-based capital ratios for high volatility commercial real estate acquisition, development and construction loans, certain past due non-residential mortgage loans and certain mortgage-backed and other securities exposures.

