During 2022, FinCEN issued proposed regulations for a pilot program to permit financial institutions to share suspicious activity information with their foreign branches, subsidiaries and affiliates to combat illicit finance risks under the AML Act. The foregoing is only a summary of selected provisions of the AML Act. Given that regulations implementing the new AML Act are being proposed but have not yet been adopted or implemented, the Company cannot determine at this time the effect, if any, the AML Act will have on the Company’s future results of operations or financial condition.
